import React from 'react';
import Toggler from './Toggler';

function App() {

  function onToggle(e){
    console.log(e);
  }

  return (
    <React.Fragment>
      <p>Hello</p>
      <p>World</p>

      <Toggler onToggle={onToggle} />

    </React.Fragment>
  );
}

export default App;
